function inicializa(){
    canvas=document.getElementById("canvas");
    ctx=canvas.getContext("2d");
    blanco=new Image();
    negro=new Image(); 
    verde=new Image();
    azul=new Image();
    rojo=new Image();
    blanco.src="images/blanco.png";
    negro.src="images/negro.png";
    verde.src="images/verde.png";
    azul.src="images/azul.png";
    rojo.src="images/rojo.png";

    fecha=new Date();

    coordenadaInicialFinal();
}
function dibujar(){
    ctx.drawImage(blanco,0,0,100,100,0,0,1000,1000);
    for(var valor=0;valor<listaBase.length;valor+=3){
        if(listaBase[valor+2]==1){
            ctx.drawImage(negro,0,0,100,100,listaBase[valor],listaBase[valor+1],10,10);
        }
        if(listaBase[valor+2]==2){
            ctx.drawImage(verde,0,0,100,100,listaBase[valor],listaBase[valor+1],10,10);
        }
        if(listaBase[valor+2]==4){
            ctx.drawImage(rojo,0,0,100,100,listaBase[valor],listaBase[valor+1],10,10);
        }
    }
    for(var valor=0;valor<listaFinal.length;valor+=2){
        ctx.drawImage(azul,0,0,100,100,listaFinal[valor],listaFinal[valor+1],10,10);
    }
}
function coordenadaInicialFinal(){
    //Generar bloque Verde inicial
    ran1=(parseInt(Math.random()*50)+25).toString();
    ran1=ran1+(parseInt(Math.random()*50)+25).toString();
    if(ran1.length==3){ran1="0"+ran1}
    if(ran1.length==2){ran1="00"+ran1}
    if(ran1.length==1){ran1="000"+ran1}
    iX=parseInt(ran1[ran1.length-4]+ran1[ran1.length-3])*10;
    iY=parseInt(ran1[ran1.length-2]+ran1[ran1.length-1])*10;

    //Generar bloque Rojo final
    ran2=(parseInt(Math.random()*50)+25).toString();
    ran2=ran2+(parseInt(Math.random()*50)+25).toString();
    if(parseInt(ran2)>=parseInt(ran1)){(parseInt(ran2)+1).toString();}
    if(ran2.length==3){ran2="0"+ran2}
    if(ran2.length==2){ran2="00"+ran2}
    if(ran2.length==1){ran2="000"+ran2}
    fX=parseInt(ran2[ran2.length-4]+ran2[ran2.length-3])*10;
    fY=parseInt(ran2[ran2.length-2]+ran2[ran2.length-1])*10;

    listaBase=[];
    listaBase.push(iX,iY,2,fX,fY,4);
}
//Pintar en pantalla a mano----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
function obtenerCoordenadasPinzel(){
    mouseX=window.event.clientX;
    mouseY=window.event.clientY;
    //Coordenada real de Canvas
    mouseCanvasX=(mouseX-17)+100;
    mouseCanvasY=(mouseY-17)+100;
    //Coordenada redondeada a múltiple de 10 más bajo.
    //Un número negativo en el borde redondea a 0, por eso se hace más 100 y menos 100
    mouseCanvasCasillaX=(parseInt(mouseCanvasX/10)*10)-100;
    mouseCanvasCasillaY=(parseInt(mouseCanvasY/10)*10)-100;
}
function pinzeladaInicio(){
    pinzelada=1;
    obtenerCoordenadasPinzel();
    mouseCanvasCasillaPrimerToqueX=mouseCanvasCasillaX;
    mouseCanvasCasillaPrimerToqueY=mouseCanvasCasillaY;
    if(iX==mouseCanvasCasillaPrimerToqueX && iY==mouseCanvasCasillaPrimerToqueY){
        condicionVerde=1;
    }
    if(fX==mouseCanvasCasillaPrimerToqueX && fY==mouseCanvasCasillaPrimerToqueY){
        condicionRojo=1;
    }
    pinzeladaMovimiento();
}
function pinzeladaFinal(){
    pinzelada=0;
    condicionVerde=0;
    condicionRojo=0;
}
function pinzeladaMovimiento(){
    obtenerCoordenadasPinzel();
    //Si coordendas dentro de canvas y no en el borde y estado 0 y pinzelada 1
    if(estado==0 && pinzelada==1 && mouseCanvasCasillaX>=0 && mouseCanvasCasillaX<=990 && mouseCanvasCasillaY>=0 && mouseCanvasCasillaY<=990){
        //Movimiento verde
        if(condicionVerde==1){
            //Quitar las cordenadas de la lista
            for(var valor=0;valor<listaBase.length;valor+=3){
                if(iX==listaBase[valor] && iY==listaBase[valor+1]){
                    listaBase.splice(valor,1);
                    listaBase.splice(valor,1);
                    listaBase.splice(valor,1);
                }
            }
            //Se añaden las nuevas coordenadas
            obtenerCoordenadasPinzel();
            //Si no están fuera del canvas y el bloque está vacio
            if(mouseCanvasCasillaX>=0 && mouseCanvasCasillaX<=990 && mouseCanvasCasillaY>=0 && mouseCanvasCasillaY<=990){
                condicionVerde=0;
                for(var valor=0;valor<listaBase.length;valor+=3){
                    if(mouseCanvasCasillaX==listaBase[valor] && mouseCanvasCasillaY==listaBase[valor+1]){
                        condicionVerde=1;
                    }
                }
                if(condicionVerde==0){
                    iX=mouseCanvasCasillaX,iY=mouseCanvasCasillaY;
                }
            }
                       
            listaBase.push(iX,iY,2);
            condicionVerde=1;
        }

        //Movimiento rojo
        if(condicionRojo==1){
            //Quitar las cordenadas de la lista
            for(var valor=0;valor<listaBase.length;valor+=3){
                if(fX==listaBase[valor] && fY==listaBase[valor+1]){
                    listaBase.splice(valor,1);
                    listaBase.splice(valor,1);
                    listaBase.splice(valor,1);
                }
            }
            //Se añaden las nuevas coordenadas
            obtenerCoordenadasPinzel();
            if(mouseCanvasCasillaX>=0 && mouseCanvasCasillaX<=990 && mouseCanvasCasillaY>=0 && mouseCanvasCasillaY<=990){
                condicionRojo=0;
                for(var valor=0;valor<listaBase.length;valor+=3){
                    if(mouseCanvasCasillaX==listaBase[valor] && mouseCanvasCasillaY==listaBase[valor+1]){
                        condicionRojo=1;
                    }
                }
                if(condicionRojo==0){
                    fX=mouseCanvasCasillaX,fY=mouseCanvasCasillaY;
                }
            }
                       
            listaBase.push(fX,fY,4);
            condicionRojo=1;
        }

        //Movimiento negro
        if(condicionVerde==0 && condicionRojo==0){
            obtenerCoordenadasPinzel();
            if(mouseCasillaActualX!=mouseCanvasCasillaX || mouseCasillaActualY!=mouseCanvasCasillaY){
                mouseCasillaActualX=mouseCanvasCasillaX;
                mouseCasillaActualY=mouseCanvasCasillaY;
                //Si no están fuera del canvas y no está ni en verde ni en rojo
                if((mouseCasillaActualX!=iX || mouseCasillaActualY!=iY)&&(mouseCasillaActualX!=fX || mouseCasillaActualY!=fY)&&(mouseCasillaActualX>=0 && mouseCasillaActualX<=990 && mouseCasillaActualY>=0 && mouseCasillaActualY<=990)){
                    condicionNegro=0;
                    for(var valor=0;valor<listaBase.length;valor+=3){
                        if(listaBase[valor]==mouseCasillaActualX && listaBase[valor+1]==mouseCasillaActualY){
                            listaBase.splice(valor,1);
                            listaBase.splice(valor,1);
                            listaBase.splice(valor,1);
                            condicionNegro=1;
                        }
                    }
                    if(condicionNegro==0){
                        listaBase.push(mouseCasillaActualX,mouseCasillaActualY,1);
                    }
                }   
            }
        }
    }
}   
